function Delete({ id }) {
  useEffect(() => {
    function handleDeleteUSer(id) {
      fetch(`http://localhost:9000/ApiYoutube/${id}`, {
        method: 'DELETE',
      }).then((res) => res.json().then((data) => console.log(data)));
    }
  }, []);
  return <button onClick={() => handleDeleteUSer(id)}>Delete</button>;
}

export default Delete;
